  `channel_code` varchar(32) NOT NULL COMMENT '转账渠道编码',
  `merchant_transfer_id` varchar(64) NOT NULL COMMENT '商户转账单编号',
  `type` int(11) NOT NULL COMMENT '类型',
  `status` tinyint(4) NOT NULL COMMENT '转账状态',
  `success_time` datetime DEFAULT NULL COMMENT '转账成功时间',
  `price` int(11) NOT NULL COMMENT '转账金额，单位：分',
  `subject` varchar(512) NOT NULL COMMENT '转账标题',
  `user_name` varchar(64) DEFAULT NULL COMMENT '收款人姓名',
  `alipay_logon_id` varchar(64) DEFAULT NULL COMMENT '支付宝登录号',
  `openid` varchar(64) DEFAULT NULL COMMENT '微信 openId',
  `notify_url` varchar(1024) NOT NULL COMMENT '异步通知商户地址',
  `user_ip` varchar(50) NOT NULL COMMENT '用户 IP',
  `channel_extras` varchar(512) DEFAULT NULL COMMENT '渠道的额外参数',
  `channel_transfer_no` varchar(64) DEFAULT NULL COMMENT '渠道转账单号',
  `channel_error_code` varchar(128) DEFAULT NULL COMMENT '调用渠道的错误码',
  `channel_error_msg` varchar(256) DEFAULT NULL COMMENT '调用渠道的错误提示',
  `channel_notify_data` varchar(4096) DEFAULT NULL COMMENT '渠道的同步/异步通知的内容',
  `creator` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '创建者',
  `create_time` datetime NOT NULL DEFAULT current_timestamp() COMMENT '创建时间',
  `updater` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '更新者',
  `update_time` datetime NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT '更新时间',
  `deleted` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否删除',
  `tenant_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '租户编号',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci COMMENT='转账单表';

