-- ----------------------------
-- Table structure for `product_sku`
-- ----------------------------
DROP TABLE IF EXISTS `product_sku`;
CREATE TABLE `product_sku` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `spu_id` bigint(20) NOT NULL COMMENT 'spu编号',
  `properties` varchar(512) DEFAULT NULL COMMENT '属性数组，JSON 格式',
  `price` int(11) NOT NULL DEFAULT -1 COMMENT '商品价格，单位：分',
  `market_price` int(11) DEFAULT NULL COMMENT '市场价，单位：分',
  `cost_price` int(11) NOT NULL DEFAULT -1 COMMENT '成本价，单位： 分',
  `bar_code` varchar(64) DEFAULT NULL COMMENT 'SKU 的条形码',
  `pic_url` varchar(256) NOT NULL COMMENT '图片地址',
  `stock` int(11) DEFAULT NULL COMMENT '库存',
  `weight` double DEFAULT NULL COMMENT '商品重量，单位：kg 千克',
  `volume` double DEFAULT NULL COMMENT '商品体积，单位：m^3 平米',
  `sub_commission_first_price` int(11) DEFAULT NULL COMMENT '一级分销的佣金，单位：分',
  `sub_commission_second_price` int(11) DEFAULT NULL COMMENT '二级分销的佣金，单位：分',
  `sales_count` int(11) DEFAULT NULL COMMENT '商品销量',
  `creator` varchar(64) DEFAULT '',
  `create_time` timestamp NOT NULL DEFAULT current_timestamp(),
  `updater` varchar(64) DEFAULT '',
  `update_time` timestamp NOT NULL DEFAULT current_timestamp(),
  `deleted` bit(1) NOT NULL DEFAULT b'0',
  `tenant_id` bigint(20) NOT NULL DEFAULT 0,
  `first_brokerage_price` int(11) DEFAULT NULL COMMENT '一级分销的佣金，单位：分',
  `second_brokerage_price` int(11) DEFAULT NULL COMMENT '二级分销的佣金，单位：分',
  `allocate_count` int(11) DEFAULT 0 COMMENT '已分配数量',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1890002315282161666 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci COMMENT='商品sku';

-- ----------------------------
-- Records of product_sku
-- ----------------------------

-- ----------------------------
-- Table structure for `product_spu`
-- ----------------------------
DROP TABLE IF EXISTS `product_spu`;
CREATE TABLE `product_spu` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '商品 SPU 编号，自增',
  `name` varchar(128) NOT NULL COMMENT '商品名称',
  `keyword` varchar(256) DEFAULT NULL COMMENT '关键字',
  `introduction` varchar(256) DEFAULT NULL COMMENT '商品简介',
  `description` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `bar_code` varchar(64) DEFAULT NULL COMMENT '条形码',
  `category_id` bigint(20) NOT NULL COMMENT '商品分类编号',
  `brand_id` bigint(11) DEFAULT NULL COMMENT '商品品牌编号',
  `pic_url` varchar(256) NOT NULL COMMENT '商品封面图',
  `slider_pic_urls` varchar(2000) DEFAULT '' COMMENT '商品轮播图地址\n 数组，以逗号分隔\n 最多上传15张',
  `video_url` varchar(256) DEFAULT NULL COMMENT '商品视频',
  `unit` tinyint(4) DEFAULT NULL COMMENT '单位',
  `sort` int(11) NOT NULL DEFAULT 0 COMMENT '排序字段',
  `status` tinyint(4) NOT NULL COMMENT '商品状态: 0 上架（开启） 1 下架（禁用）-1 回收',
  `spec_type` bit(1) NOT NULL COMMENT '规格类型：0 单规格 1 多规格',
  `price` int(11) NOT NULL DEFAULT -1 COMMENT '商品价格，单位使用：分',
  `market_price` int(11) NOT NULL COMMENT '市场价，单位使用：分',
  `cost_price` int(11) NOT NULL DEFAULT -1 COMMENT '成本价，单位： 分',
  `stock` int(11) NOT NULL DEFAULT 0 COMMENT '库存',
  `delivery_template_id` bigint(20) DEFAULT NULL,
  `recommend_hot` bit(1) NOT NULL COMMENT '是否热卖推荐: 0 默认 1 热卖',
  `recommend_benefit` bit(1) NOT NULL COMMENT '是否优惠推荐: 0 默认 1 优选',
  `recommend_best` bit(1) NOT NULL COMMENT '是否精品推荐: 0 默认 1 精品',
  `recommend_new` bit(1) NOT NULL COMMENT '是否新品推荐: 0 默认 1 新品',
  `recommend_good` bit(1) NOT NULL COMMENT '是否优品推荐',
  `give_integral` int(11) NOT NULL COMMENT '赠送积分',
  `give_coupon_template_ids` varchar(512) DEFAULT '' COMMENT '赠送的优惠劵编号的数组',
  `sub_commission_type` bit(1) NOT NULL COMMENT '分销类型',
  `activity_orders` varchar(16) NOT NULL DEFAULT '' COMMENT '活动显示排序0=默认, 1=秒杀，2=砍价，3=拼团',
  `sales_count` int(11) DEFAULT 0 COMMENT '商品销量',
  `virtual_sales_count` int(11) DEFAULT 0 COMMENT '虚拟销量',
  `browse_count` int(11) DEFAULT 0 COMMENT '商品点击量',
  `creator` varchar(64) DEFAULT '',
  `create_time` timestamp NOT NULL DEFAULT current_timestamp(),
  `updater` varchar(64) DEFAULT '',
  `update_time` timestamp NOT NULL DEFAULT current_timestamp(),
  `deleted` bit(1) NOT NULL DEFAULT b'0',
  `tenant_id` bigint(20) DEFAULT 0,
  `give_gift` bigint(20) DEFAULT NULL COMMENT '赠送礼品',
  `is_limit_time` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否限时购买',
  `limit_time_start` datetime DEFAULT NULL COMMENT '限时开始时间',
  `limit_time_end` datetime DEFAULT NULL COMMENT '限时结束时间',
  `limit_count` int(11) DEFAULT 0 COMMENT '限购数量',
  `is_first_product` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否首单优惠商品',
  `free_shipping` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否包邮',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1890002315164721155 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci COMMENT='商品spu';

-- ----------------------------
-- Records of product_spu
-- ----------------------------

