-- ----------------------------
-- Table structure for `promotion_article`
-- ----------------------------
DROP TABLE IF EXISTS `promotion_article`;
CREATE TABLE `promotion_article` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `category_id` bigint(20) NOT NULL,
  `dept_id` int(11) DEFAULT NULL COMMENT '部门id  公会id',
  `title` varchar(255) NOT NULL,
  `author` varchar(100) DEFAULT NULL,
  `pic_url` varchar(255) DEFAULT NULL,
  `introduction` varchar(2000) DEFAULT NULL,
  `browse_count` varchar(255) DEFAULT NULL,
  `sort` int(11) NOT NULL,
  `status` int(11) NOT NULL,
  `if_exhibition` int(11) NOT NULL DEFAULT 0 COMMENT '是否列表展示',
  `spu_id` bigint(20) DEFAULT NULL,
  `recommend_hot` bit(1) NOT NULL DEFAULT b'1',
  `recommend_banner` bit(1) NOT NULL DEFAULT b'0',
  `content` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `creator` varchar(64) DEFAULT '',
  `create_time` datetime NOT NULL DEFAULT current_timestamp(),
  `updater` varchar(64) DEFAULT '',
  `update_time` datetime NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `deleted` bit(1) NOT NULL DEFAULT b'0',
  `tenant_id` bigint(20) DEFAULT NULL,
  `publish_date` datetime DEFAULT NULL COMMENT '发布时间',
  `tag` varchar(255) DEFAULT NULL COMMENT '标签',
  `attr01` varchar(255) DEFAULT NULL COMMENT '备用01',
  `attr02` varchar(255) DEFAULT NULL COMMENT '备用02',
  `attr03` varchar(255) DEFAULT NULL COMMENT '备用03',
  `attr04` varchar(255) DEFAULT '' COMMENT '备用04',
  `attr05` varchar(255) DEFAULT NULL COMMENT '备用05',
  `qrcode_url` varchar(255) DEFAULT '' COMMENT '小程序码图片地址',
