-- ----------------------------
-- Table structure for `system_question`
-- ----------------------------
DROP TABLE IF EXISTS `system_question`;
CREATE TABLE `system_question` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `name` varchar(255) NOT NULL COMMENT '问卷名称',
  `pic_url` varchar(255) DEFAULT NULL COMMENT '封面图',
  `description` text DEFAULT NULL COMMENT '简介',
  `content` text DEFAULT NULL COMMENT '内容',
  `creator` varchar(64) DEFAULT '' COMMENT '创建者',
  `create_time` datetime NOT NULL DEFAULT current_timestamp() COMMENT '创建时间',
  `updater` varchar(64) DEFAULT '' COMMENT '更新者',
  `update_time` datetime NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT '最后更新时间',
  `deleted` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否删除',
  `score` decimal(20,2) DEFAULT NULL COMMENT '默认评分',
  `limit_time` int(11) DEFAULT NULL COMMENT '限制时间',
  `member_num` int(11) DEFAULT NULL COMMENT '使用人数',
  `hit_count` varchar(100) DEFAULT NULL COMMENT '点击数（热度）虚拟',
  `comment` text DEFAULT NULL COMMENT '指导语',
  `is_answer` int(11) DEFAULT NULL COMMENT '是否允许查看结果',
  `is_comment` int(11) DEFAULT NULL COMMENT '是否允许查看指导建议',
  `is_memberinfo` int(11) DEFAULT NULL COMMENT '是否需要完善会员资料',
  `is_graphic` int(11) DEFAULT NULL COMMENT '是否需要图形报表',
  `topic_count` int(11) DEFAULT NULL COMMENT '题目数',
  `start_time` datetime DEFAULT NULL COMMENT '开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '结束时间',
  `resurvey_time` varchar(255) DEFAULT NULL COMMENT '重测时间',
  `type` int(11) DEFAULT NULL COMMENT '类型',
  `status` int(11) DEFAULT 0 COMMENT '状态',
  `factor_max_axis` int(11) DEFAULT NULL COMMENT '因子Y轴最大值',
  `dimension_max_axis` int(11) DEFAULT NULL COMMENT '维度Y轴最大值',
  `total_max_axis` int(11) DEFAULT NULL COMMENT '总分Y轴最大值',
  `display_name` varchar(255) DEFAULT NULL COMMENT '显示名称',
  `order_no` int(11) DEFAULT NULL COMMENT '排序号',
  `is_stat` int(11) DEFAULT 0 COMMENT '是否统计',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci COMMENT='量表管理表';

