  `after_sale_refund_reasons` text DEFAULT NULL COMMENT '售后的退款理由',
  `after_sale_return_reasons` text DEFAULT NULL COMMENT '售后的退货理由',
  `delivery_express_free_enabled` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否启用全场包邮',
  `delivery_express_free_price` int(11) DEFAULT NULL COMMENT '全场包邮的最小金额，单位：分',
  `delivery_pick_up_enabled` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否开启自提',
  `brokerage_enabled` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否启用分佣',
  `brokerage_enabled_condition` int(11) DEFAULT NULL COMMENT '分佣模式',
  `brokerage_bind_mode` int(11) DEFAULT NULL COMMENT '分销关系绑定模式',
  `brokerage_poster_urls` varchar(2000) DEFAULT NULL COMMENT '分销海报图地址数组',
  `brokerage_first_percent` int(11) DEFAULT NULL COMMENT '一级返佣比例',
  `brokerage_second_percent` int(11) DEFAULT NULL COMMENT '二级返佣比例',
  `brokerage_withdraw_min_price` int(11) DEFAULT NULL COMMENT '用户提现最低金额',
  `brokerage_withdraw_fee_percent` int(11) DEFAULT NULL COMMENT '用户提现手续费百分比',
  `brokerage_bank_names` varchar(1000) DEFAULT NULL COMMENT '提现银行',
  `brokerage_frozen_days` int(11) DEFAULT NULL COMMENT '佣金冻结时间(天)',
  `brokerage_withdraw_types` varchar(1000) DEFAULT NULL COMMENT '提现方式',
  `creator` varchar(64) DEFAULT '' COMMENT '创建者',
  `create_time` datetime NOT NULL DEFAULT current_timestamp() COMMENT '创建时间',
  `updater` varchar(64) DEFAULT '' COMMENT '更新者',
  `update_time` datetime NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT '最后更新时间',
  `deleted` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否删除',
  `delivery_express_free_qty` int(11) DEFAULT NULL COMMENT '全场包邮的最小数量',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci COMMENT='交易中心配置';

