  `combination_activity_id` bigint(20) DEFAULT NULL COMMENT '拼团活动编号',
  `combination_head_id` bigint(20) DEFAULT NULL COMMENT '拼团团长编号',
  `combination_record_id` bigint(20) DEFAULT NULL COMMENT '拼团记录编号',
  `exchange_code` varchar(100) DEFAULT NULL COMMENT '兑换码',
  `activity_id` bigint(20) DEFAULT NULL COMMENT '抽选活动ID',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=36 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci COMMENT='交易订单表';

